import React from "react";
import ReactDom from "react-dom";

function Booklist() {
  return (
    <section>
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
    </section>
  );
}

const Book = () => {
  return (
    <article>
      <Image></Image>
      <Title />
      <Author />
    </article>
  );
};

const Image = () => {
  <img
    src="https://images-na.ssl-images-amazon.com/images/W/WEBP_402378-T2/images/I/717wykgZcBL._AC_UL900_SR900,600_.jpg"
    alt=" "
  />;
};

const Title = () => <h1>The January 6th Report</h1>;

const Author = () => <h1>Shashank Pandey</h1>;

ReactDom.render(<Booklist />, document.getElementById("root"));
